Defendant Elizabeth N Schuenke in court, in custody, with attorney Jorge R Fragoso.   Brian J. Juech appeared for the State of Wisconsin.
Plea Colloquy.
Defendant enters a guilty plea to Count 1.  Court finds defendant guilty.    Penalty enhancer struck by Court upon motion of the State.  

The Court Orders the Following:

Imposed and Stayed Sentence of:

2 Years 2 months Imprisonment 
- 1 Year 2 months of Initial Confinement
- 1 Year of Extended Supervision

Term of Probation: 2 Years

Conditions of Probation:
- AODA Assessment and follow through with any treatment recommended;
- Compass Assessment and follow through with any recommendations;
- Absolute Sobriety; Random U.A.s;
- Any valid prescription drugs must be taken in the manner in which they are prescribed;
- Inform agent of all prescriptions;
- Sign Medical Release for Agent;
- Follow through with any treatment and/or counseling recommended by Agent;
- Maintain/Obtain full time employment and or schooling;
- No contact with co-defendant Austin M.;
- Provide DNA sample if not yet provided  and pay surcharge.

Costs: $268.00 
DNA Surcharge:  $250.00
(To be paid as a condition of probation )

Condition Time:  90 days Jail - Stayed and to be used at the agent's discretion.  

Defendant is eligible for the Challenge Incarceration Program
Defendant is eligible for the Substance Abuse Program


Expunction is denied.
